class Solution(object):
    def commonChars(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        ans = []
        for letter in words[0]:
            flag = 0
            print(letter)
            for string in words:
                print(string)
                idx = words.index(string)
                if string == words[0]:
                    continue
                else:
                    if letter in string:
                        flag += 1
                        string = list(string)
                        string.remove(letter)
                        string = ''.join(string)
                        words[idx] = string
                        print(string)
                print(flag)
            if flag == (len(words) -1):
                ans.append(letter)

        return ans

